window.CCTools=function(e){return{CURSOR:0,GRANDMA:1,FARM:2,FACTORY:3,MINE:4,SHIPMENT:5,ALCHEMYLAB:6,PORTAL:7,TIMEMACHINE:8,CONDENSER:9,Game:e,nextGoldenCookie:function(){return new Date(Date.now()+this.Game.goldenCookie.delay/this.Game.fps*1e3)},howLong:function(e){return new Date((e-this.Game.cookies)/this.Game.cookiesPs*1e3+Date.now())},howLongNextObjectLevel:function(e){return e>=0||e<=9?this.howLong(this.Game.ObjectsById[9].price):null},howLongObjectLevel:function(e,t){var n=Game.ObjectsById[e].price,r=1.15,i=t-this.Game.ObjectsById[e].bought;return this.howLong(n*(1+r*((1-Math.pow(r,i))/(1-r))))},calculatePrestige:function(){var e=this.Game.cookiesReset+this.Game.cookiesEarned,t=e/1e12,n=Math.max(0,Math.floor((-1+Math.pow(1+8*t,.5))/2));return n},chipsCost:function(e){return(Math.pow(2*e+1,2)-1)/8*1e12},nextChipCost:function(){var e=this.calculatePrestige()+1;return this.chipsCost(e)*1e12-this.Game.cookiesReset}}}(Game);
